        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-3921934529":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"exclamation\",\"color\":\"#060006\",\"hotspots\":[{\"position\":{\"x\":24.599908637738853,\"y\":57.36853871855347},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Dirígete a tu armario o cajón y selecciona un par de calcetines que estén limpios.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a233b99d-5a68-4a21-9ccb-1920ed36c646\"}],\"header\":\"Buscar calcetines\"},{\"position\":{\"x\":44.83310479686094,\"y\":93.16475039308176},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Elige un par de zapatos adecuados para la actividad que vas a realizar, asegurándote de que estén en buen estado y sean cómodos.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"2f77e0b3-3558-4c71-919c-51b7af153a6e\"}],\"header\":\"Escoger zapatos\"},{\"position\":{\"x\":59.12208513522399,\"y\":51.891804245283026},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Coloca cada calcetín en su respectivo pie, estirándolos bien para que queden ajustados y sin arrugas que puedan incomodar.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"688ad63d-de8f-42e8-89b2-6018a075570f\"}],\"header\":\"Ponerte los calcetines\"},{\"position\":{\"x\":79.01234576622537,\"y\":93.1345322327044},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Introduce cada pie con cuidado en el zapa
